import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  BarElement,
  CategoryScale,
  LinearScale,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(BarElement, CategoryScale, LinearScale, Tooltip, Legend);

interface Student {
  name: string;
  email: string;
  department: string;
  semester: string;
  rollNo: string;
  profileImage?: string;
}

const StudentDashboard: React.FC = () => {
  const [studentData, setStudentData] = useState<Student | null>(null);
  const [activeTab, setActiveTab] = useState("Dashboard");
  const [darkMode, setDarkMode] = useState(false);
  const [aiFeedback, setAiFeedback] = useState("");

  useEffect(() => {
    // Fake student data
    setStudentData({
      name: "Sadia Naz",
      email: "sadianaz123@gmail.com",
      department: "Information Technology",
      semester: "7th Semester",
      rollNo: "BSIT-2021-45",
      profileImage:
        "https://cdn-icons-png.flaticon.com/512/3135/3135715.png",
    });

    // Fake AI feedback
    setAiFeedback(
      "Your academic performance is consistently improving! Focus on practical projects to strengthen your portfolio."
    );
  }, []);

  const handleLogout = () => {
    alert("Logout successful!");
  };

  return (
    <div
      className={`min-h-screen flex ${
        darkMode ? "bg-gray-900 text-white" : "bg-gray-100 text-gray-900"
      }`}
    >
      {/* Sidebar */}
      <motion.aside
        initial={{ x: -100, opacity: 0 }}
        animate={{ x: 0, opacity: 1 }}
        className={`w-64 p-6 shadow-lg flex flex-col justify-between ${
          darkMode ? "bg-gray-800" : "bg-white"
        }`}
      >
        <div>
          <h2 className="text-2xl font-bold text-blue-600 mb-6 text-center">
            ðŸŽ“ Student Dashboard
          </h2>

          {/* Profile section */}
          <div
            onClick={() => setActiveTab("Profile")}
            className={`flex flex-col items-center cursor-pointer mb-8 ${
              activeTab === "Profile" ? "text-blue-500" : ""
            }`}
          >
            <img
              src={studentData?.profileImage}
              alt="Profile"
              className="w-20 h-20 rounded-full border-2 border-blue-500 object-cover"
            />
            <p className="mt-2 font-semibold">{studentData?.name}</p>
          </div>

          <nav className="space-y-3">
            {[
              "Dashboard",
              "Results",
              "Attendance",
              "Messaging",
              "Events",
              "Announcements",
              "Library",
            ].map((item) => (
              <button
                key={item}
                onClick={() => setActiveTab(item)}
                className={`w-full text-left px-4 py-2 rounded-lg transition ${
                  activeTab === item
                    ? "bg-blue-600 text-white"
                    : darkMode
                    ? "hover:bg-gray-700"
                    : "hover:bg-gray-100"
                }`}
              >
                {item}
              </button>
            ))}
          </nav>
        </div>

        <button
          onClick={handleLogout}
          className="w-full mt-6 py-2 rounded-lg bg-red-500 hover:bg-red-600 text-white font-semibold"
        >
          Logout
        </button>
      </motion.aside>

      {/* Main Content */}
      <main className="flex-1 p-8 overflow-y-auto">
        {/* Dashboard */}
        {activeTab === "Dashboard" && (
          <>
            <motion.div
              className="mb-8"
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
            >
              <h1 className="text-3xl font-bold text-blue-600 mb-2">
                Welcome, {studentData?.name || "Student"} ðŸ‘‹
              </h1>
              <p className="text-gray-500">
                {new Date().toLocaleDateString("en-GB", {
                  weekday: "long",
                  day: "numeric",
                  month: "short",
                  year: "numeric",
                })}
              </p>
            </motion.div>

            <div className="grid md:grid-cols-2 gap-8">
              {/* Attendance Chart */}
              <motion.div
                className={`rounded-2xl shadow-md p-6 ${
                  darkMode ? "bg-gray-800" : "bg-white"
                }`}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
              >
                <h3 className="text-lg font-semibold mb-4 text-blue-600">
                  Weekly Attendance Overview
                </h3>
                <Bar
                  data={{
                    labels: ["Week 1", "Week 2", "Week 3", "Week 4"],
                    datasets: [
                      {
                        label: "Attendance %",
                        data: [85, 90, 88, 92],
                        backgroundColor: "rgba(37,99,235,0.6)",
                        borderRadius: 6,
                      },
                    ],
                  }}
                  options={{
                    responsive: true,
                    plugins: { legend: { display: false } },
                    scales: {
                      y: {
                        beginAtZero: true,
                        ticks: { color: darkMode ? "#fff" : "#000" },
                      },
                      x: { ticks: { color: darkMode ? "#fff" : "#000" } },
                    },
                  }}
                />
              </motion.div>

              {/* GPA Results Chart */}
              <motion.div
                className={`rounded-2xl shadow-md p-6 ${
                  darkMode ? "bg-gray-800" : "bg-white"
                }`}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
              >
                <h3 className="text-lg font-semibold mb-4 text-blue-600">
                  Semester GPA Trend
                </h3>
                <Bar
                  data={{
                    labels: ["Sem 1", "Sem 2", "Sem 3", "Sem 4"],
                    datasets: [
                      {
                        label: "GPA",
                        data: [2.8, 3.2, 3.4, 3.6],
                        backgroundColor: "rgba(99,102,241,0.6)",
                        borderRadius: 6,
                      },
                    ],
                  }}
                  options={{
                    responsive: true,
                    plugins: { legend: { display: false } },
                    scales: {
                      y: {
                        beginAtZero: true,
                        max: 4,
                        ticks: {
                          stepSize: 0.5,
                          color: darkMode ? "#fff" : "#000",
                        },
                      },
                      x: { ticks: { color: darkMode ? "#fff" : "#000" } },
                    },
                  }}
                />
              </motion.div>
            </div>

            {/* AI Feedback */}
            <motion.div
              className={`rounded-2xl shadow-md p-6 mt-8 ${
                darkMode ? "bg-gray-800" : "bg-white"
              }`}
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
            >
              <h3 className="text-lg font-semibold mb-3 text-blue-600">
                AI Performance Insight ðŸ¤–
              </h3>
              <p className="text-sm leading-relaxed text-gray-500 dark:text-gray-300">
                {aiFeedback}
              </p>
            </motion.div>
          </>
        )}

        {/* Profile */}
        {activeTab === "Profile" && (
          <motion.div
            className={`rounded-2xl shadow-md p-6 ${
              darkMode ? "bg-gray-800" : "bg-white"
            }`}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
          >
            <h2 className="text-xl font-semibold mb-4 text-blue-600">
              Profile Details
            </h2>
            <ul className="space-y-2 text-gray-600 dark:text-gray-300">
              <li><strong>Name:</strong> {studentData?.name}</li>
              <li><strong>Email:</strong> {studentData?.email}</li>
              <li><strong>Department:</strong> {studentData?.department}</li>
              <li><strong>Semester:</strong> {studentData?.semester}</li>
              <li><strong>Roll No:</strong> {studentData?.rollNo}</li>
            </ul>
          </motion.div>
        )}
      </main>
    </div>
  );
};

export default StudentDashboard;
